import Table from 'react-bootstrap/Table';
import { useFetchContactQuery } from '../studentApi';

function ContactList() {
  const {data} = useFetchContactQuery()
  console.log(data);
  return (
    <Table striped bordered hover variant="dark" style={{width:"700px" , margin:"20px auto"}}> 
      <thead>
        <tr>
          <th>Id</th>
          <th>Email</th>
          <th>Name</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>1</td>
          <td>Mark</td>
          <td>Otto</td>
        </tr>
        <tr>
          <td>2</td>
          <td>Jacob</td>
          <td>Thornton</td>
  
        </tr>
       
      </tbody>
    </Table>
  );
}

export default ContactList;
